import "/media/hp/107 GB Volume1/WebDev/Projects/giftbazar/src/Components/Achivements/Achivements.css"; // Import the CSS file from the same directory

const Achievements = () => {
  return (
    <section className="achievements-section">
      <div className="container">
        <div className="row">
          <div className="col-md-3">
            <div className="achievement">
              <div className="achievement-icon">
                <span className="icon-energy icons" />
