              <div className="achievement-number">
                <h6>
                  <strong
                    className="achievement-counter"
                    data-from={0}
                    data-to={3000}
                  >
                    3,000+
                  </strong>
                </h6>
              </div>
              <div className="achievement-title">Sets Sold</div>
            </div>
          </div>
          {/* Repeat the same structure for other achievements */}
        </div>
      </div>
    </section>
  );
};

export default Achievements;
